import { Link, Redirect } from 'react-router-dom';
import { Button } from 'react-bootstrap';


export default (props) => {
    const { pos, route } = props;
    if (pos === 'L') {
        if (route !== "") {
            return (
                <>
                    <Redirect to={'/order/diy/' + route}><h3>&#60;</h3></Redirect>
                </>
            ) 
        }
        else {
            return (
                <>
                </>
            ) 
        }
    }
    else if (pos === 'R'){
        if (route !== "") {
            return (
                <>
                   <Redirect to={'/order/diy/'+route}><h3>&#62;</h3></Redirect>
                </>
            )
        }
        else {
            return (
                <>
                </>
            )
        }
    }
}
